const initialState = {
  work:null,
  isLoading:true,
};


export default function work(state=initialState, action) {
  // let workList = state.slice();

  switch (action.type) {
    case 'FETCH_WORK':
      return {...state,work:action.work, isLoading:false};

    case 'ADD_WORK':
      return state;

    case 'DELETE_WORK':
      // workList.splice(action.id,1);
      return state;

    default:
      return state;

  }
}
